import React from 'react';
import { Switch, Route } from 'react-router-dom';
import Login from '../containers/Login';
import PrivateRoute from './PrivateRoute';
import Dashboard from '../containers/Dashboard';
import HighOrderLayout from '../containers/HighOrderLayout';

function Routers() {
  return (
    <Switch>
      <Route path='/login' component={Login} />
      <PrivateRoute path='/' component={HighOrderLayout(Dashboard)} />
      <PrivateRoute path='/operations' component={HighOrderLayout(Dashboard)} />
      <PrivateRoute path='/tracking' component={HighOrderLayout(Dashboard)} />
      <PrivateRoute path='/reports' component={HighOrderLayout(Dashboard)} />
      <PrivateRoute
        path='/configurations'
        component={HighOrderLayout(Dashboard)}
      />
    </Switch>
  );
}

export default Routers;
